    "Fast, modern and advanced photo management suite" : "Schnelle, moderne und fortschrittliche Fotoverwaltungssuite",
    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# Memories: Fotoverwaltung für Nextcloud\n\nMemories ist eine Fotoverwaltungslösung für Nextcloud mit erweiterten Funktionen, darunter:\n\n- **📸 Timeline**: Fotos und Videos nach Aufnahmedatum sortieren, geparst aus Exif-Daten.\n- **⏪ Zurückspulen**: Springe sofort zu einem beliebigen Zeitpunkt in der Vergangenheit und erlebe deine Erinnerungen erneut.\n- **🤖 KI-Tagging**: Gruppiere Fotos nach Personen und Objekten, unterstützt von [recognize](https://github.com/nextcloud/recognize) und [facerecognition](https://github.com/matiasdelellis/facerecognition ).\n- **🖼️ Alben**: Erstelle Alben, um Fotos und Videos zu gruppieren. Dann teile diese Alben mit anderen.\n- **🫱🏻‍🫲🏻 Externes Teilen**: Teile Fotos und Videos mit Personen außerhalb deiner Nextcloud-Instanz.\n- **📱 Mobiler Support**: Arbeite von jedem Gerät jeder Form und Größe über die Web-App.\n- **✏️ Metadaten bearbeiten**: Bearbeite Daten und andere Metadaten auf Fotos schnell und in großen Mengen.\n- **📦 Archiv**: Speichere Fotos, die du nicht in deiner Chronik sehen möchtest, in einem separaten Ordner.\n- **📹 Videotranskodierung**: Videos transkodieren und HLS für maximale Leistung verwenden.\n- **🗺️ Karte**: Zeige deine Fotos auf einer Karte an, die mit genauer umgekehrter Geokodierung versehen ist.\n- **📦 Migration**: Migriere einfach von Nextcloud Photos und Google Takeout.\n- **⚡️ Leistung**: Mach das alles sehr schnell.\n\n## 🚀 Installation\n\n1. Installiere die App aus dem Nextcloud App Store (oder probiere [hier] eine Demo aus (https://demo.memories.gallery/apps/memories/).\n1. Führe die empfohlenen [Konfigurationsschritte] durch (https://demo.memories.gallery/apps/memories/).\n1. Führe `php occ memories:index` aus, um Metadaten-Indizes für vorhandene Fotos zu generieren.\n1. Öffne die App 📷 Memories in Nextcloud und lege das Verzeichnis mit deinen Fotos fest.",
